//convinacion de todos los reducer login calendar ui

import { combineReducers } from 'redux';
import { calendarReducer } from './calandarReducer';
import { uiReducer } from "./uiReduce";

export const rootReducer = combineReducers({
    ui: uiReducer,
    calendar: calendarReducer
})
